values:
this will probably be my last update.&nbsp; 
 
 he found out today that there is more cancer in his esaphogus.&nbsp; there is nothing left for him to do.&nbsp; too weak for chemo /radiation and too weak for another surgery of that magnitude.
 
 he cried with me alone in the room and i was told that was the first time he has shown that emotion among anyone else.&nbsp; my uncle, the closest thing to my brother, is going to pass away from this.
 
 no time frame was given, just basically as long as his body can hold out.&nbsp;&nbsp; 
 
 today i have felt worse and cried more than i have ever done in one day and its not over yet.&nbsp; 
 
 thank you all for your thoughts, you guys are my second family thank you.

munkiy :)

Well

my uncle is in Los Angeles and is preparing to have his surgery.&nbsp; its so scary, his life is literally in this doctors hands.&nbsp; they chose him because for this type of surgery, removing the stomach and replacing with other organs, he is number one in the country.

since he stopped&nbsp;doing chemo and was doing radiation only he has greatly improved though, eating much more, if you remember&nbsp;the cancer was in his throat and he wasnt able to eat anything.&nbsp; but he is more talkative on the fone and able to move around the house a lot more.&nbsp; the&nbsp; doctor&nbsp;told him this is a life changing surgery and that afterwards&nbsp;he would never eat the same.&nbsp; smaller amounts and more often and some foods is a no no for a long time.

im terified to be honest.&nbsp;&nbsp;

i am just praying that everything goes smoothly the surgery is monday, last about 8 hours to get it all done at the 4 hour mark they stop and make sure his blood&nbsp;vessels are still pumping strong enough and able to continue for the next half.&nbsp; if not he will have to wait about a month for them to reheal and&nbsp;go back for the 2nd part.&nbsp; we are all hoping that wont happen.&nbsp;&nbsp;he will have to stay in cali until end of february most likely to be close to that doctor and make sure everything is going ok internaly and wiht his&nbsp;digestion and everything.&nbsp; he will be in the hospital&nbsp;itself for&nbsp;a period of 7 to 14 days after surgery.&nbsp;&nbsp;

he told me that will be the hardest part im hoping he&nbsp;so drugged up that&nbsp;the time goes quickly.

we went to his house this last tuesday for a bit and got to sit and watch tv with him he joked a bit like he always does but when he talked about it ...&nbsp;i just told him to stay strong not to worry about anything else then yourself and healing.&nbsp;&nbsp;

it all goes down monday.&nbsp; i wish i could be there&nbsp;but i cant be.&nbsp; he said he knows and that i shouldnt worry because&nbsp;he will be out of it anyways and stuff but you know, its having people around you that care when you need it.

ill update again when i found something out.

&nbsp;

God,
Please don't take&nbsp;Shawn&nbsp;home yet, please give him strength to fight through this.&nbsp; to give him strength for the surgery.&nbsp; give him the ability to eat&nbsp;what he needs to be daily.&nbsp;&nbsp;

let him find a doctor that can do the surgery soon.&nbsp; he needs it.

Amen.&nbsp;

Well we made it :)

hte flight from phoenix got delayed because some bitchass got sick and the plane was ready to fly away and next thing we know we are being told to get off because one fo the plane poeple were sick and that if they can't find a replacement then teh flight will be cancelled and since NASCAR was here that weekend no other flights to new york were available until the next day... panic....&nbsp; so after about 30 minutes sitting there waiting they said they found a replcament and we will be leaving in another 30 minutes.&nbsp; so instead of having a liesure stroll through new york airport wiht an hour and 30 minute layover it was a mad dash throught 65 gates in 10 minutes or less to catch the flight it Israel.

but that flight was nice, freiken long but nice.&nbsp;&nbsp;&nbsp; huge plane, saw night at the museum about 3 times and slept some.&nbsp;&nbsp; 10 hours on the plane is harsh though.

when we landed we hung out at her parents and her mom made so much food it was great tasty stuff.&nbsp;&nbsp;&nbsp;&nbsp;

saw fireworks for their independence day and now we gonna go with her mom to hang out at the mall for a bit and spend some monies -.-&nbsp; its nice here temperature wise.&nbsp;&nbsp;

i likes -.-
